import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <nav id="navbar" class="nav">
        <div class="nav-list">
          <a href="#about">About</a>
          <a href="#projects">Projects</a>
          <a href="#contact">Contact</a>
        </div>
      </nav>
    </div>
  );
}

export default App;
